import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>June 28 2021</div>

      <div className="expense-item__descriptio">
        <h2>Car Insurance</h2>
        <div className="expense-item__price">RS.799</div>
      </div>
    </div>
  );
}
export default ExpenseItem;
